import React from 'react';
import s from './Home.module.css';

const SocialIcon = (socImages) => {

    return (
        <div className={s.body}>
            <a href="#"><img style={{ display: "inline" }} src={socImages.iconSrc} alt={'na xer'} /></a>
        </div>
    );
}

export default SocialIcon;
